                    &lt;p&gt;אל תהסס לפנות אם יש לך שאלות.&lt;/p&gt;
                    &lt;p&gt;תודה&lt;/p&gt;
                    &lt;p&gt;&lt;strong&gt;בברכה,&lt;/strong&gt;&lt;/p&gt;
