&lt;p style=&quot;text-align: center;&quot;&gt;&lt;span style=&quot;font-size: 18pt;&quot;&gt;&lt;strong&gt;رسالة عرض&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;


