            &lt;p&gt;休暇、従業員の福利厚生、勤務時間、異動ポリシーなどであり、独自の裁量により随時変更される場合があります。&lt;/p&gt;

            &lt;p&gt;当社のそのようなポリシー決定はすべて、あなたを拘束し、その範囲で本契約を無効にするものとします。&lt;/p&gt;



            &lt;p&gt;14. 準拠法・裁判管轄&lt;/p&gt;

